import { Row, Col } from "react-bootstrap";
import ActionButton from "src/Components/UI/ActionButton/ActionButton";
import { FormInput } from "src/Components/UI/Input/FormInput";
import classes from "./AddOrderItem.module.css";
import { useSelector } from "react-redux";
const AddOrderItem = () => {
  const mapStateToProps = (state) => {
    return {
      listData: state.saleStore.orderItem,
    };
  };
  const state = useSelector(mapStateToProps);
  console.log();
  return (
    <Row>
      <FormInput type="text" label="Product Name" readOnly={false} size={4} />
      <FormInput type="number" label="Quantity" readOnly={false} size={2} />
      <Col md={2}>
        <ActionButton
          value="Edit Item"
          name="cil-align-center"
          class={classes.view}
        />
        |{" "}
        <ActionButton
          value="Remove from List"
          name="cil-trash"
          class={classes.delete}
        />
      </Col>
    </Row>
  );
};
export default AddOrderItem;
